css:
/* Variables */
/* Inline variables */
atom-text-editor,
:host {
  background-color: #373838;
  color: #cdcdcd;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(0, 0, 0, 0.5);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #ffffff;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #cdcdcd;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #373838;
  color: #cdcdcd;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(0, 0, 0, 0.5);
  color: #ffffff;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #ffffff;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #868a8c;
}
atom-text-editor .invisible,
:host .invisible {
  color: #cdcdcd;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(0, 0, 0, 0.5);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background: rgba(255, 255, 255, 0.2);
  border: 1px solid #868a8c;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  background: rgba(255, 255, 255, 0.2);
  border: 1px solid #ffffff;
}
.comment {
  color: #85878a;
}
.entity.name.type {
  color: #cc99cc;
}
.entity.other.inherited-class {
  color: #94c7b5;
}
.keyword {
  color: #ffeead;
}
.keyword.control {
  color: #63a1c2;
}
.keyword.operator {
  color: #cda869;
}
.keyword.other.special-method {
  color: #6dc5dc;
}
.keyword.other.unit {
  color: #9dbedd;
}
.storage {
  color: #ffeead;
}
.constant {
  color: #9dbedd;
}
.constant.character.escape {
  color: #ffffff;
}
.constant.numeric {
  color: #ff9b62;
}
.constant.other.color {
  color: #ffffff;
}
.constant.other.symbol {
  color: #99ccaa;
}
.variable {
  color: #63a1c2;
}
.variable.interpolation {
  color: #4489ae;
}
.variable.parameter.function {
  color: #cdcdcd;
}
.invalid.illegal {
  color: #f2777a;
}
.string {
  color: #99ccaa;
}
.string.regexp {
  color: #ffffff;
}
.string.regexp .source.ruby.embedded {
  color: #9dbedd;
}
.string.other.link {
  color: #63a1c2;
}
.punctuation.definition.comment {
  color: #85878a;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #cdcdcd;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #6dc5dc;
}
.punctuation.definition.bold {
  color: light-orange;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #ffeead;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #4489ae;
}
.support.class {
  color: #ffffff;
}
.support.function {
  color: #ffffff;
}
.support.function.any-method {
  color: #6dc5dc;
}
.entity.name.function {
  color: #6dc5dc;
}
.entity.name.class,
.entity.name.type.class {
  color: light-orange;
}
.entity.name.section {
  color: #6dc5dc;
}
.entity.name.tag {
  color: #63a1c2;
}
.entity.other.attribute-name {
  color: #9dbedd;
}
.entity.other.attribute-name.id {
  color: #cc99cc;
}
.meta.class {
  color: light-orange;
}
.meta.link {
  color: #9dbedd;
}
.meta.require {
  color: #6dc5dc;
}
.meta.selector {
  color: #ffeead;
}
.meta.separator {
  background-color: #3a3a3a;
  color: #cdcdcd;
}
.none {
  color: #cdcdcd;
}
.markup.bold {
  color: #9dbedd;
  font-weight: bold;
}
.markup.changed {
  color: #ffeead;
}
.markup.deleted {
  color: #63a1c2;
}
.markup.italic {
  color: #ffeead;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #6dc5dc;
}
.markup.inserted {
  color: #99ccaa;
}
.markup.list {
  color: #63a1c2;
}
.markup.quote {
  color: #9dbedd;
}
.markup.raw.inline {
  color: #99ccaa;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #99ccaa;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
/* Extras */
.punctuation.section.embedded.begin.php,
.punctuation.section.embedded.end.php,
.meta.tag.sgml.doctype.html {
  background: #141414;
  color: #f7f7f7;
}
.entity.other.attribute-name.class {
  color: #e3c485;
}
.keyword.control.at-rule.import,
.punctuation.definition.keyword {
  color: #8addf4;
}
.constant.other.color.rgb-value.scss {
  color: #8fbbd2;
}
.keyword.other.unit {
  color: #ff9b62;
}
.punctuation.definition.tag.begin.html,
.punctuation.definition.tag.begin.php,
.punctuation.definition.tag.end.html,
.punctuation.definition.tag.end.php,
.punctuation.definition.tag.html {
  color: #63a1c2;
}
.keyword.control.php {
  color: #ffeead;
}
.meta.function-call.php {
  color: white;
}
.entity.other.attribute-name.html {
  color: #ffeead;
}
.support.function.string.php {
  color: #cc99cc;
}
.editor.is-focused .line.cursor-line {
  background: rgba(0, 0, 0, 0.2);
}
.bracket-matcher {
  border-bottom: 1px solid lime;
  position: absolute;
  border: 1px solid rgba(255, 255, 255, 0.3);
  background-color: rgba(0, 0, 0, 0.7);
}
.leading-whitespace {
  color: rgba(0, 0, 0, 0);
  position: relative;
  box-shadow: inset 1px 0 0 rgba(255, 255, 255, 0.1);
}
